import { Link } from "react-router-dom";

export default function Item(data) {
  return (
    <div className="service">
      <img src={data.src} alt="Web Design" />
      <h4>{data.title}</h4>
      <p>{data.description}</p>
      <Link to={data.url}> გაიგე მეტი</Link>
    </div>
  );
}
